import React from 'react';
import { Form } from 'react-bootstrap';

export default function SearchBar() {
  const formControlStyle =
    { width: "50%", height: "35px", borderRadius: "10px", };

    const faviconStyle={
      backgroundColor:"white"
    }

  return (
    <div>
      <Form className="form-horizontal">
        <span>
        <Form.Group>
          <Form.Control type="text" className="search-bar" name="reaturantSearch" placeholder=" Search for a restaurant, city or cuisine"
            style={formControlStyle}>
          </Form.Control>
          <i className="fa fa-search" style={{faviconStyle}}></i>
        </Form.Group>
        <Form.Group>

        </Form.Group>
        </span>

      </Form>
    </div>
  )
}
